import React, { Component } from 'react';
import Afternav from "../Coponent/nav_after";

export default class orders extends Component {
    render() {
        return (
            <div className="order">
                <div className="order-container">
                    <Afternav />
                    <h2>Your Order</h2>
                    <section className="order-section">
                        <p>
                            <h3>first order</h3>
                        </p>
                        <p>
                            <h3>second order</h3>
                        </p>
                        <p>
                            <h3>third order</h3>
                        </p>
                    </section>
                </div>
            </div>
        );
    }
}
